import React from 'react';
import { Link } from 'react-router-dom';

const HomePage = () => {
    return (
        <div className="min-h-screen bg-gradient-to-r from-teal-100 via-cyan-200 to-blue-100 flex flex-col justify-center items-center p-6">
            <header className="text-center mb-12">
                <h1 className="text-4xl font-bold text-gray-800 mb-4">Welcome to DERMATEL</h1>
                <p className="text-lg text-gray-600">Your Telemedicine Solution for Eczema Management</p>
            </header>
            <div className="flex flex-col md:flex-row md:space-x-8">
                <Link to="/login">
                    <button className="bg-teal-500 text-white py-2 px-4 rounded shadow-md hover:bg-teal-600 transition duration-300 mb-4 md:mb-0">
                        Login
                    </button>
                </Link>
                <Link to="/register">
                    <button className="bg-blue-500 text-white py-2 px-4 rounded shadow-md hover:bg-blue-600 transition duration-300">
                        Register
                    </button>
                </Link>
            </div>
        </div>
    );
};

export default HomePage;
